import { Link } from '@navikt/ds-react'
import React from 'react'

function base64ToArrayBuffer(_base64Str: string) {
  const binaryString = window.atob(_base64Str)
  const binaryLen = binaryString.length
  const bytes = new Uint8Array(binaryLen)
  for (let i = 0; i < binaryLen; i++) {
    const ascii = binaryString.charCodeAt(i)
    bytes[i] = ascii
  }
  return bytes
}

const ByggDummyDataUrl = ({ tittel, type }: { tittel: React.ReactNode; type?: string }) => {
  let byte
  if (type == 'barnebrilleSak') {
    byte = base64ToArrayBuffer(pdfBarnebrilleSak)
  } else {
    byte = base64ToArrayBuffer(pdf)
  }
  const blob = new Blob([byte], { type: 'application/pdf' })
  const url = URL.createObjectURL(blob)
  return (
    <Link href={url} target="_blank" rel="noreferrer">
      {tittel}
    </Link>
  )
}

export default ByggDummyDataUrl

const pdf =
  ''

const pdfBarnebrilleSak =
  ''
